import React from 'react';

function Party() {
  return (
    <div className="landing_page">
      <h1> Schedule</h1>
      <p> Here's what to expect during our wedding weekend. There will also be a printout of this schedule available in your hotel rooms. 
        We can't wait to celebrate with you!
      </p>

      <h1> Saturday, 16 Mar, 2024 </h1>
      <h3> Ceremony </h3>
      <p> 16:30 </p>
      <p> Garden, Mia Resort, Nha Trang </p>

      <h3> Reception </h3>
      <p> 17:00 </p>
      <p> La Baia, Mia Resort, Nha Trang </p>
    </div>
  );
}

export default Party;
